import './App.css';
import Home from './pages/Home';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import LoginPage from './pages/LoginPage';


function App() {
  return (
   <BrowserRouter>
  <Routes>
<Route path='/' element={<Home/>} >  </Route>
<Route path='/login' element={<LoginPage/>} >  </Route>


  </Routes>

   </BrowserRouter>


  );
}

export default App;
